import React, { lazy, Suspense } from "react";
import { Route } from "react-router-dom";
import routesFront from "../../shared/routes/routesFrontend.routes";
const IndexPerson = lazy(() =>
  import("../components/index").then((m) => ({
    default: m.IndexPerson,
  }))
);
export const RouterPerson = () => {
  return (
    <>
      <Route path={routesFront.module}>
        <Route
          path={routesFront.person}
          element={
            <Suspense fallback={<div>Loading...</div>}>
              <IndexPerson />
            </Suspense>
          }
        ></Route>
      </Route>
    </>
  );
};
